import AxiosInstance from '../Axios';
import { React } from "react";
import { useState, useEffect } from 'react';

function Home(){
    const [title, setTitle] = useState("");
  
    useEffect(() => {
      AxiosInstance
        .get("/api/users/")
        .then((res) =>{
          const rest = res["data"]["results"][0]["username"];
          setTitle(rest);
          console.log(res);
        })
        .catch((error)=>{
          setTitle("error");
          console.log(error);
        });
    });
    
  
    return(
      <div>
        <Typography variant = "h1">{title}</Typography>
        <Link to = "Logout">Log out</Link>
      </div>
    )
  }

  export default Home;
